import React, {useState} from 'react';
import ItemImg from "./itemImg";
import QuerySelect from "./querySelect";
import "./album.scss"
import classNames from "classnames";

const Album = () => {
    const [hidden, SetState] = useState(true)
    const classes = classNames({
        hidden: hidden,
        "cont_img_animated":!hidden,
    })
    return (
        <div className="main_cont">
            <div className="cont_shadow">
                <div className="cont_flex">
                    <div className="cont_query">
                        <QuerySelect/>
                        <QuerySelect/>
                        <div className="query_button">
                            <button onClick={() => SetState(state => false)}>Показать</button>
                        </div>
                    </div>
                    <div className={classes}>
                        <div className="query_text">Финал г. Волгоград, 2023 Класс SPL Sedan
                        </div>
                        <div className="cont_img">
                            <ItemImg/>
                            <ItemImg/>
                            <ItemImg/>
                            <ItemImg/>
                            <ItemImg/>
                            <ItemImg/>
                            <ItemImg/>
                            <ItemImg/>
                        </div>
                    </div>
                </div>

            </div>
        </div>
    );
};

export default Album;
